void init_gpio(void)
{
	GPIO_InitTypeDef GPIO_InitStructure;
	RCC_AHB1PeriphClockCmd(RCC_AHB1Periph_GPIOB, ENABLE);

	GPIO_InitStructure.GPIO_Mode = GPIO_Mode_OUT;
	GPIO_InitStructure.GPIO_OType = GPIO_OType_PP;
	GPIO_InitStructure.GPIO_PuPd  = GPIO_PuPd_DOWN;
	GPIO_InitStructure.GPIO_Speed = GPIO_Speed_50MHz;

	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_7;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_8;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
}

static void i2c_pin_test(void)
{
	
	GPIO_InitTypeDef GPIO_InitStructure;
	RCC_AHB1PeriphClockCmd(RCC_AHB1Periph_GPIOB, ENABLE);
	
	GPIO_InitStructure.GPIO_Mode = GPIO_Mode_OUT;
	GPIO_InitStructure.GPIO_OType = GPIO_OType_OD;
	GPIO_InitStructure.GPIO_PuPd  = GPIO_PuPd_NOPULL;
	GPIO_InitStructure.GPIO_Speed = GPIO_Speed_50MHz;
	
	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_7;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_8;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
	
	
	GPIO_WriteBit(GPIOB, GPIO_Pin_7, Bit_RESET);	// SDA
	GPIO_WriteBit(GPIOB, GPIO_Pin_8, Bit_RESET);	// SCL
	
	GPIO_WriteBit(GPIOB, GPIO_Pin_8, Bit_SET);	// SCL
	GPIO_WriteBit(GPIOB, GPIO_Pin_7, Bit_SET);	// SDA
	dly_tsk(1);
	GPIO_WriteBit(GPIOB, GPIO_Pin_8, Bit_RESET);	// SCL
	GPIO_WriteBit(GPIOB, GPIO_Pin_7, Bit_RESET);	// SDA
	
}

#define STTS751_I2C_PORT	I2C2

static void i2c_init(void)
{
	GPIO_InitTypeDef GPIO_InitStructure;
	I2C_InitTypeDef  I2C_InitStructure;
	
	RCC_APB1PeriphClockCmd(RCC_APB1Periph_I2C2, ENABLE);
	RCC_AHB1PeriphClockCmd(RCC_AHB1Periph_GPIOB, ENABLE);
	
	GPIO_PinAFConfig(GPIOB, GPIO_PinSource10, GPIO_AF_I2C1);
	GPIO_PinAFConfig(GPIOB, GPIO_PinSource11, GPIO_AF_I2C1);
	
	GPIO_InitStructure.GPIO_Mode = GPIO_Mode_AF;
	GPIO_InitStructure.GPIO_OType = GPIO_OType_OD;
	GPIO_InitStructure.GPIO_PuPd  = GPIO_PuPd_NOPULL;
	GPIO_InitStructure.GPIO_Speed = GPIO_Speed_50MHz;
	
	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_10;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
	GPIO_InitStructure.GPIO_Pin = GPIO_Pin_11;
	GPIO_Init(GPIOB, &GPIO_InitStructure);
	
	I2C_DeInit(STTS751_I2C_PORT);
	
	I2C_StructInit(&I2C_InitStructure);
	I2C_InitStructure.I2C_Mode = I2C_Mode_I2C;
	I2C_InitStructure.I2C_OwnAddress1 = 0x08;
	I2C_InitStructure.I2C_Ack = I2C_Ack_Enable;
	I2C_InitStructure.I2C_AcknowledgedAddress = I2C_AcknowledgedAddress_7bit;
	I2C_InitStructure.I2C_ClockSpeed = 9600;
	
	I2C_Cmd(STTS751_I2C_PORT, ENABLE);
	I2C_Init(STTS751_I2C_PORT, &I2C_InitStructure);
	
	I2C_GenerateSTART(STTS751_I2C_PORT, ENABLE);
	while(!I2C_CheckEvent(STTS751_I2C_PORT, I2C_EVENT_MASTER_MODE_SELECT)) {
		dly_tsk(1);
	}
	I2C_Send7bitAddress(STTS751_I2C_PORT, 0x72<<1, I2C_Direction_Transmitter);
	while(!I2C_CheckEvent(STTS751_I2C_PORT, I2C_EVENT_MASTER_TRANSMITTER_MODE_SELECTED)) {
		dly_tsk(1);
	}
	I2C_SendData(STTS751_I2C_PORT, 0x03);
	while(!I2C_CheckEvent(STTS751_I2C_PORT, I2C_EVENT_MASTER_BYTE_TRANSMITTED)) {
		dly_tsk(1);
	}
	I2C_SendData(STTS751_I2C_PORT, 0x8c);
	while(!I2C_CheckEvent(STTS751_I2C_PORT, I2C_EVENT_MASTER_BYTE_TRANSMITTED)) {
		dly_tsk(1);
	}
	I2C_GenerateSTOP(STTS751_I2C_PORT, ENABLE);
	
}

static uint8_t i2c_read(uint8_t adr)
{
	uint8_t data;
	
	while(I2C_GetFlagStatus(I2C1, I2C_FLAG_BUSY))
	{
		dly_tsk(1);
	}
	
	I2C_GenerateSTART(I2C1, ENABLE);
	while(!I2C_CheckEvent(I2C1, I2C_EVENT_MASTER_MODE_SELECT)) {
		dly_tsk(1);
	}
	I2C_Send7bitAddress(I2C1, adr << 1, I2C_Direction_Receiver);
	while(!I2C_CheckEvent(I2C1, I2C_EVENT_MASTER_RECEIVER_MODE_SELECTED)) {
		dly_tsk(1);
	}
	while(!I2C_CheckEvent(I2C1, I2C_EVENT_MASTER_BYTE_RECEIVED)) {
		dly_tsk(1);
	}
	data = I2C_ReceiveData(I2C1);
	I2C_GenerateSTOP(I2C1, ENABLE);
	return data;
}

